import React from 'react'
import InputAdornment from '@material-ui/core/InputAdornment';
import TextField from '@material-ui/core/TextField';
import { FaUserAlt } from "react-icons/fa";
import { AiFillLock } from "react-icons/ai";
import { GrMail } from "react-icons/gr";
import { FaPhoneAlt } from "react-icons/fa";


function Signup() {
    const box={
        width:'70%',
        height:'80vh',
        backgroundColor:'white',
        boxShadow:'0px 5px 15px black',
        position:'absolute',
        top:'100px',
        marginRight:'15%',
        marginLeft:'15%', 
    }
    const text={
        margin:'20px',
        fontWeight:'bold',
        fontSize:'2.3rem'
    }
    const frm={
        color:'white',
        marginLeft:'auto',
        marginRight:'auto',
    }
    return (
        <>
        <div style={box}>
            <h1 style={text}>Create User</h1>
            <div style={frm}> 
            <TextField
                fullWidth
        id="input-with-icon-textfield"
        placeholder="UserName"
        label=""
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
                <FaUserAlt/>
            </InputAdornment>
          ),
        }}
      />   
            <TextField
                fullWidth
        id="input-with-icon-textfield"
        placeholder="Email"
        type="email"
        label=""
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
                <GrMail/>
            </InputAdornment>
          ),
        }}
      />    
         
      <TextField
                fullWidth
        id="input-with-icon-textfield"
        placeholder="Password"
        type="password"
        label=""
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
                <AiFillLock/>
            </InputAdornment>
          ),
        }}
      />
      <TextField
                fullWidth
        id="input-with-icon-textfield"
        placeholder="Contact"
        type="number"
        label=""
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
                <FaPhoneAlt/>
            </InputAdornment>
          ),
        }}
      />
            </div>
            </div>
        </>
    )
}

export default Signup
